import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p id="title">
          RAT SIMULATOR
        </p>
        <div className="entry-container">
          <p>This is a rat simulator. Learn more in <a>About</a>.</p>
          <div className = "submit">Simulate</div>
        </div>
      </header>
    </div>
  );
}

export default App;
